const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  }));

const Middle = () => {
  return (
    <div className='middlecontainer'>
        <div>
        <h1 id='easy'>Planting Trees is easy!</h1>
        </div>

        <Box>
